/**
 * PDFDocument Class
 * @typedef {object} PDFDocument
 */

/**
 * Add header with logo and company information to the given document
 * @param {PDFDocument} doc
 */
const generateHeader = (doc) =>
  doc
    // .image(require("path").resolve(__dirname, "./logo.jpg"), 50, 40, {
    //   height: 50,
    // })
    // Embedding the image directly to use in browser
    .image(
      "data:image/jpeg;base64,",
      50,
      40,
      { height: 50 }
    )
    .fillColor("#444444")
    .fontSize(10)
    .text("Ministry Of Pup LLP", 200, 50, { align: "right" })
    .text("43 Kampong Bahru Rd", 200, 65, { align: "right" })
    .text("Singapore, 169359", 200, 80, { align: "right" })
    .moveDown();

/**
 * Generate a new row in a table
 * @param {PDFDocument} doc
 * @param {String} name Name of the item
 * @param {String} description Item's description
 * @param {String|Number} unitCost Cost per unit of item
 * @param {String|Number} quantity Number of item sold
 * @param {String|Number} lineTotal unitCost * quantity
 */
function generateTableRow(
  doc,
  name,
  description = "",
  unitCost,
  quantity,
  lineTotal
) {
  // Set y to be the current y value, so that all the text methods can reuse this y method
  // If y is not passed into text method, every new call to text will create a new line
  // But since we want this entire row to be on the same line, they must have the same y
  const y = doc.y;

  doc
    .fontSize(10)
    .text(name, 50, y)
    .text(description, 150, y, { width: 190 })
    .text(unitCost, 342, y, { width: 70, align: "right" })
    .text(quantity, 400, y, { width: 70, align: "right" })
    .text(lineTotal, 0, y, { align: "right" });

  // Since usually description will be the one that have word wrapping of multiple lines,
  // Here we use the same max width for description column to calculate how many lines were added for word wrap
  // Move doc's Y position down by number of lines it word wrapped, defaults to at least 1 line down.
  doc.moveDown(
    Math.ceil(doc.widthOfString(description, { width: 190 }) / 190) || 1
  );
}

/**
 * Function to generate hr HTML seperator tag
 * @param {PDFDocument} doc
 * @param {Number} [y=doc.y + 6] Optional positional height that defaults to current y position plus some padding
 */
const generateHr = (doc, y) =>
  doc
    .strokeColor("#dbdbdb")
    .lineWidth(1)
    .moveTo(50, y || doc.y + 6)
    .lineTo(550, y || doc.y + 6)
    .stroke();

/**
 * Add a footer string
 * @param {PDFDocument} doc
 * @param {String} string Text to show in the footer
 */
const generateFooter = (doc, string) =>
  doc
    .font("Helvetica")
    .fontSize(10)
    .text(string, 50, 780, { align: "center", width: 500 });

/**
 * Format a dollar amount in cents to a string in dollars, e.g. 1090 to $10.90, e.g. 1000000 $10,000.00
 *
 * References
 * - https://stackoverflow.com/a/17663871
 * - https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Number/toLocaleString#using_options
 * @param {Number} cents Dollar amount in cents
 * @returns {String} Dollar amount in dollars unit
 */
const formatCurrency = (cents) =>
  "$" +
  (cents / 100).toLocaleString("en-SG", {
    minimumFractionDigits: 2,
    maximumFractionDigits: 2,
  });

/**
 * Takes a date object and returns a string in the format of e.g. 'Monday, 18 October 2021'
 * @param {Date} date
 * @returns {String} Formatted date string
 */
const formatDate = (date) =>
  new Intl.DateTimeFormat("en-SG", {
    dateStyle: "full",
    timeZone: "Asia/Singapore",
  }).format(date);

module.exports = {
  generateHeader,
  generateFooter,
  generateTableRow,
  generateHr,
  formatCurrency,
  formatDate,
};
